import React, { Component } from 'react';
import {Link} from 'react-router-dom';


const RobotsCard = (props) => {
	const {name,id,email} = props
  return (
    <div className='container'>
	    <div className=" row">
		    <div className="col-lg py-3 m-3 h-50 shadow-lg">
			    <Link to= './details'>
			    <img alt='robots' src={`https://robohash.org/test?200x200'${id}`} />
			    </Link>
				<h3>{name}</h3>
			    <p>{email}</p>
		    </div>
	   </div>
    </div>
  )
}

export default RobotsCard;
